import React from 'react';


import { BrowserRouter as Router  , Route , Switch , Link } from 'react-router-dom';
import Login from './Views/login';
import Register from './Views/register';  



function App() {
  return (
  <Router>

    <Route path='/login'>
    <Login/>
    </Route>
    <Route path='/register'>
    <Register/>
    </Route>



  </Router>
  
  );
}

export default App;
